import React from "react";
import "./App.css";
import Title from "./Components/Title";
import CampsiteItems from "./Components/CampsiteItems";
import TotalNumberOfItems from "./Components/TotalNumberOfItems";

class App extends Component {
  state = {
    items: 0
  };
  render() {
    return (
      <div>
        <Title />
        <TotalNumberOfItems />
        <CampsiteItems />
      </div>
    );
  }
}

export default App;
